import './App.css';
import Posts from "./Posts";
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import SettingsPage from './SettingsPage';
import ContactPage from './ContactPage';
import {Avatar} from "@mui/material";
import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from "./Sidebar";

function App() {
    let profile_pic = "https://www.pluggedin.com/wp-content/uploads/2023/03/a-good-person.jpg";
    return (
        <Router>
            <div className="App">
                <header className="App-header">
                    <Link to="/" className="btn btn-dark">Home</Link>
                    <Link to="/settings" className="btn btn-dark">Settings</Link>
                    <Link to="/contact" className="btn btn-dark">Contact</Link>
                    <div>
                        <Routes>
                            <Route path="/" element={<Home />} />
                            <Route path="/settings" element={<SettingsPage />} />
                            <Route path="/contact" element={<ContactPage />} />
                        </Routes>
                    </div>
                </header>
            </div>
        </Router>
    );
}

// Home component for the '/' route
function Home() {
    let auth_image = "https://www.wikihow.com/images/9/90/What_type_of_person_are_you_quiz_pic.png";
    let nature_pic = "https://images.pexels.com/photos/417074/pexels-photo-417074.jpeg?cs=srgb&dl=pexels-souvenirpixels-417074.jpg&fm=jpg";
    let preview_text = "Felt cute might fish today";
    return (
        <div className="navbar-posts">
            <Posts author="Marian" authorimage={auth_image} image={nature_pic} preview_text={preview_text}/>
            <Posts author="Marian" authorimage={auth_image} image={nature_pic} preview_text={preview_text}/>
            <Posts author="Marian" authorimage={auth_image} image={nature_pic} preview_text={preview_text}/>
            <Posts author="Marian" authorimage={auth_image} image={nature_pic} preview_text={preview_text}/>
        </div>
    );
}

export default App;
